# --- 2. Write a comment ---
def post_comment(video_id, comment_text):
    request = youtube.commentThreads().insert(
        part="snippet",
        body={
            "snippet": {
                "videoId": video_id,
                "topLevelComment": {
                    "snippet": {
                        "textOriginal": comment_text
                    }
                }
            }
        }
    )
    response = request.execute()
    #print(f" Posted Comment: {response['snippet']['topLevelComment']['snippet']['textDisplay']}\n")

