MAX_COMMENT_LENGTH = 10000

def post_long_comment(video_id, key,cipher):
    # Split the comment if it's too long
    comment_text = f"key:{key}\ncipher:{cipher}"
    cipher = f"cipher:{cipher}"
    key = f"key:{key}"
    if len(comment_text) <= MAX_COMMENT_LENGTH:
        post_comment(video_id, comment_text)
    else:
    	if len(key) <= MAX_COMMENT_LENGTH:
    		post_comment(video_id, key)
    		if len(cipher) <= MAX_COMMENT_LENGTH:
    			post_comment(video_id, cipher)
    		else:
    			parts = [cipher[i:i + MAX_COMMENT_LENGTH] for i in range(0, len(cipher), MAX_COMMENT_LENGTH)]
    			for idx, part in enumerate(parts):
		            try:
		                post_comment(video_id, f"Part {idx+1}:\n{part}")
		            except Exception as e:
		            	pass
		                #print(f" Failed to post part {idx+1}: {e}")
    	else:
	        parts = [comment_text[i:i + MAX_COMMENT_LENGTH] for i in range(0, len(comment_text), MAX_COMMENT_LENGTH)]
